import React, { useState } from 'react';

function DoctorUpdateProfile() {
    const [doctorInfo, setDoctorInfo] = useState({
        fullName: 'Nguyễn Văn A',
        idCard: '123456789',
        gender: 'Nam',
        dob: '1990-01-01',
        email: 'example@gmail.com',
        phoneNumber: '0123456789',
        address: 'Địa chỉ của bác sĩ',
        specialization: 'Răng hàm mặt',
        qualifications: [],
        experience: '',
    });

    const [newQualification, setNewQualification] = useState('');
    const [newExperience, setNewExperience] = useState('');

    const handleChange = (event) => {
        const { name, value } = event.target;
        setDoctorInfo((prevInfo) => ({
            ...prevInfo,
            [name]: value,
        }));
    };

    const handleAddQualification = () => {
        if (newQualification.trim() !== '') {
            setDoctorInfo((prevInfo) => ({
                ...prevInfo,
                qualifications: [...prevInfo.qualifications, newQualification],
            }));
            setNewQualification('');
        }
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        // TODO: Handle form submission logic
    };

    return (
        <div>
            <h2>Cập nhật thông tin cá nhân</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Họ tên:</label>
                    <input
                        type="text"
                        name="fullName"
                        value={doctorInfo.fullName}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>CMND/CCCD:</label>
                    <input
                        type="text"
                        name="idCard"
                        value={doctorInfo.idCard}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Giới tính:</label>
                    <input
                        type="text"
                        name="gender"
                        value={doctorInfo.gender}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Ngày tháng năm sinh:</label>
                    <input
                        type="text"
                        name="dob"
                        value={doctorInfo.dob}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Email:</label>
                    <input
                        type="text"
                        name="email"
                        value={doctorInfo.email}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Số điện thoại:</label>
                    <input
                        type="text"
                        name="phoneNumber"
                        value={doctorInfo.phoneNumber}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Địa chỉ:</label>
                    <input
                        type="text"
                        name="address"
                        value={doctorInfo.address}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Chuyên ngành:</label>
                    <input
                        type="text"
                        name="specialization"
                        value={doctorInfo.specialization}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label>Bằng cấp:</label>
                    {doctorInfo.qualifications.map((qualification, index) => (
                        <div key={index}>{qualification}</div>
                    ))}
                    <div>
                        <input
                            type="text"
                            value={newQualification}
                            onChange={(event) => setNewQualification(event.target.value)}
                        />
                        <button type="button" onClick={handleAddQualification}>
                            Thêm bằng cấp
                        </button>
                    </div>
                </div>
                <div className="form-group">
                    <label>Kinh nghiệm:</label>
                    <input
                        type="text"
                        name="experience"
                        value={doctorInfo.experience}
                        onChange={handleChange}
                    />
                </div>
                {/* Các trường thông tin khác */}
                <button type="submit">Cập nhật</button>
            </form>
        </div>
    );
}

export default DoctorUpdateProfile;
